import './App.css';
import About from './views/about';
import Home from './views/home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route exact path = "/" component = {Home} />
          <Route path = "/about" component = {About}/>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
